import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Cookies from 'js-cookie';
import '../index.css'; // For general styling

const TaxHistory = () => {
  const [records, setRecords] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchTaxRecords();
  }, []);

  const fetchTaxRecords = async () => {
    setLoading(true);
    setError('');
    const jwt_token = Cookies.get('jwt_token');

    try {
      const config = {
        headers: {
          'Authorization': `Bearer ${jwt_token}`,
        },
      };
      const response = await axios.get('http://127.0.0.1:5000/tax-records', config);
      if (response.data.status === 'success') {
        setRecords(response.data.history);
      } else {
        setError(response.data.message || 'Failed to fetch tax records.');
      }
    } catch (err) {
      console.error('Error fetching tax records:', err);
      if (err.response && err.response.status === 401) {
        setError('Authentication required. Please log in again.');
      } else {
        setError('Failed to load tax history. Please check your network connection.');
      }
    } finally {
      setLoading(false);
    }
  };

  const formatCurrency = (value) => {
    if (value === null || value === undefined || isNaN(parseFloat(value))) {
      return 'N/A';
    }
    return parseFloat(value).toLocaleString('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 2,
      maximumFractionDigits: 2,
    });
  };

  const handleDownloadITR = async (recordId) => {
    setLoading(true);
    setError('');
    const jwt_token = Cookies.get('jwt_token');

    try {
      const config = {
        headers: {
          'Authorization': `Bearer ${jwt_token}`,
        },
        responseType: 'blob', // Important for receiving a file
      };
      const response = await axios.get(`http://127.0.0.1:5000/api/generate_itr_form/${recordId}`, config);

      if (response.status === 200) {
        const blob = new Blob([response.data], { type: 'application/pdf' });
        const downloadUrl = window.URL.createObjectURL(blob);
        const contentDisposition = response.headers['content-disposition'];
        let filename = `ITR_Form_${recordId}.pdf`;
        if (contentDisposition) {
            const filenameMatch = contentDisposition.match(/filename="([^"]+)"/);
            if (filenameMatch && filenameMatch[1]) {
                filename = filenameMatch[1];
            }
        }
        
        const link = document.createElement('a');
        link.href = downloadUrl;
        link.setAttribute('download', filename);
        document.body.appendChild(link);
        link.click();
        link.remove();
        window.URL.revokeObjectURL(downloadUrl);
        alert('ITR form generated and downloaded successfully!'); // Using alert as per instructions, but consider custom modal
      } else {
        const errorData = await response.data.text();
        alert(`Failed to generate ITR form: ${errorData || response.statusText}`); // Using alert
      }
    } catch (err) {
      console.error('ITR generation error:', err);
      if (err.response && err.response.data) {
        const reader = new FileReader();
        reader.onload = () => {
          try {
            const errorJson = JSON.parse(reader.result);
            alert(`Error generating ITR form: ${errorJson.message || JSON.stringify(errorJson)}`); // Using alert
          } catch (e) {
            alert(`Error generating ITR form: ${reader.result || err.response.statusText}`); // Using alert
          }
        };
        reader.readAsText(err.response.data);
      } else {
        alert('Network error or server unavailable during ITR form generation.'); // Using alert
      }
    } finally {
      setLoading(false);
    }
  };


  if (loading) {
    return <div className="loading-state">Loading tax records...</div>;
  }

  if (error) {
    return <div className="error-state"><p className="error-message">{error}</p></div>;
  }

  return (
    <div className="tax-history-container section-box">
      <h2 className="tax-uploader-title">Your Tax Filing History</h2>
      {records.length === 0 ? (
        <p>No tax records found. Upload documents to start a new filing!</p>
      ) : (
        <div className="records-list">
          {records.map((record) => (
            <div key={record._id} className="record-item section-box">
              <h3>Record ID: {record._id}</h3>
              <p><strong>Filed On:</strong> {new Date(record.timestamp).toLocaleString()}</p>
              <p><strong>User ID:</strong> {record.user_id}</p>
              {record.aggregated_financial_data && (
                <div className="aggregated-summary">
                  <h4>Aggregated Data:</h4>
                  <p><strong>Name:</strong> {record.aggregated_financial_data.name || 'N/A'}</p>
                  <p><strong>PAN:</strong> {record.aggregated_financial_data.pan || 'N/A'}</p>
                  <p><strong>Financial Year:</strong> {record.aggregated_financial_data.financial_year || 'N/A'}</p>
                  <p><strong>Gross Income:</strong> {formatCurrency(record.aggregated_financial_data.total_gross_income)}</p>
                  <p><strong>Total Deductions:</strong> {formatCurrency(record.aggregated_financial_data.total_deductions)}</p>
                  <p><strong>Total TDS:</strong> {formatCurrency(record.aggregated_financial_data.total_tds)}</p>
                </div>
              )}
              {record.final_tax_computation_summary && (
                <div className="computation-summary">
                  <h4>Computation Summary:</h4>
                  <p><strong>Computed Taxable Income:</strong> {formatCurrency(record.final_tax_computation_summary.computed_taxable_income)}</p>
                  <p><strong>Estimated Tax Payable:</strong> {formatCurrency(record.final_tax_computation_summary.estimated_tax_payable)}</p>
                  <p className={record.final_tax_computation_summary.refund_due_from_tax > 0 ? 'refund-amount' : 'tax-due-amount'}>
                    {record.final_tax_computation_summary.refund_due_from_tax > 0 ? 
                     `Refund Due: ${formatCurrency(record.final_tax_computation_summary.refund_due_from_tax)}` : 
                     `Tax Due: ${formatCurrency(record.final_tax_computation_summary.tax_due_to_government)}`}
                  </p>
                  <p><strong>Tax Regime Considered:</strong> {record.final_tax_computation_summary.regime_consideration || 'N/A'}</p>
                </div>
              )}
              {record.suggestions_from_gemini && record.suggestions_from_gemini.length > 0 && (
                <div className="suggestions-summary">
                  <h4>AI Suggestions:</h4>
                  <ul className="suggestions-list">
                    {record.suggestions_from_gemini.map((s, i) => <li key={i}>{s}</li>)}
                  </ul>
                </div>
              )}
              {record.ml_prediction_summary && (
                <div className="ml-prediction-summary">
                  <h4>ML Prediction:</h4>
                  <p><strong>Predicted Tax Regime:</strong> {record.ml_prediction_summary.predicted_tax_regime || 'N/A'}</p>
                  <p><strong>Predicted Tax Payable:</strong> {formatCurrency(record.ml_prediction_summary.predicted_tax_liability)}</p>
                </div>
              )}
              <button 
                onClick={() => handleDownloadITR(record._id)} 
                className="tax-uploader-button download-itr-button"
                disabled={loading}
              >
                Download ITR Form
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default TaxHistory;
